import React from 'react';
import styled from "styled-components";

const StyledHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const AppHeader = () => {
    return (
        <StyledHeader>
            <h1>Todo List</h1>
            <span>4 more todo, 1 done</span>
        </StyledHeader>
    )
};

export default AppHeader;
